import React from 'react'

function GenCards(props) {
    console.log(props.props);
  return (
    <div><div className="card text-bg-light mb-3" style={{maxWidth: "18rem"}}>
    <div className="card-body">
      <h5 className="card-title">{props.title}</h5>
      <p className="card-text">
        {props.que}
      </p>
      <img src={props.imgUrl} className="card-img-bottom" alt="code"/>
    </div>
  </div></div>
  )
}

export default GenCards
